import React from "react";
import {

  Description,
  Headc, TwoRowGrid,
 
} from "./Webdevelopment.element";

function Component_services_types(props) {
  return (
    <TwoRowGrid style={{border:'1p'}} >
      <Headc>
      {props.head}
      </Headc>
      <Description>
      {props.description}
      </Description>
    </TwoRowGrid>
  );
}

export default Component_services_types;
